import React, { Component } from 'react'
import {
  CardBody, Col, Row, Spinner, CardHeader,
  //Button, 
  Form, FormGroup, Label, Input
} from 'reactstrap'
import Modal1 from './components/modales'
import excelente from '../../assets/img/s/excelente.png'
import intentalodenuevo from '../../assets/img/s/intentalodenuevo.png'
import AuthService from '../../services/AuthService'
import API_CCS from '../../services/API_CCS'
const API = new API_CCS()

class TA15View extends Component {
  loading = () => (
    <div className="animated fadeIn pt-3 text-center "><Spinner color="danger" /></div>
  )


  constructor(props) {
    super(props)
    this.Auth = new AuthService();
    this.state = {
      modal: false,

      acierto1: "",
      id_ccs: this.Auth.getProfile().id_ccs,
      form: 'casosAtipicos',


    }

    this.toggleM = this.toggleM.bind(this)
  }

  toggleM(modIndex) {
    this.setState(prevState => ({
      modal: !prevState.modal,
    }))

    this.setState({ modalIndex: modIndex })
  }

  onChange(e) {
    this.setState({
      [e.target.name]: e.target.value,
    })
  }

  async onSave(e) {
    try {
      var respuesta = await API.guardaActividad(this.state.evaluacion)
      alert('Se guardo la encuesta n√∫mero ' + respuesta[0].id)
    } catch (err) {
      console.log('loggea si hay un error')
    }
  }

  dosFun() {
    this.onSave.bind(this);
    this.toggleM()

  }

  render() {
    return (
      <div className="animated fadeIn">
        <CardHeader className="text-left" style={{ paddingBottom: "0px" }}>
          <h5> POL√çTICAS DE CAPTURA THINK</h5>
        </CardHeader>
        <CardBody >
          <Row className="centrado-fila">
            <Col xs="12">
              <h1>6.  ¬øQu√© tipo de direcciones no se permiten?
              </h1>
            </Col>

            <Col xs="4">
              <div>
                <Form>
                  <div>
                    <FormGroup
                      tag="fieldset"
                    >
                      <FormGroup check>
                        <div className="centrado-fil">
                          <div>
                            <Label check>
                              <Input
                                type="radio"
                                name="acierto1"
                                id="acierto1"
                                value="1"
                                onClick={() => this.toggleM(1)}
                                onChange={this.onChange.bind(this)}
                              />
                              A) Apartado Postal, Domicilio Conocido, Plazas y Mercados, Campos Militares, 
                              Carreteras o Kil√≥metros sin Especificar, Domicilio sin Numero.
                            </Label>
                          </div>
                        </div>
                      </FormGroup>
                      <FormGroup check>
                        <div className="centrado-fil">
                          <div>
                            <Label check>
                              <Input
                                type="radio"
                                name="acierto1"
                                id="acierto1"
                                value="0"
                                onClick={() => this.toggleM(3)}
                                onChange={this.onChange.bind(this)}
                              />
                              B) C√≥digo postal, Domicilio con Numero Interior, Calles o Avenidas.
                            </Label>
                          </div>
                        </div>
                      </FormGroup>
                      <FormGroup check>
                        <div className="centrado-fil">
                          <div>
                            <Label check>
                              <Input
                                type="radio"
                                name="acierto1"
                                id="acierto1"
                                value="0"
                                onClick={() => this.toggleM(2)}
                                onChange={this.onChange.bind(this)}
                              />
                              La palabra calle en la direcci√≥n cuando forme parte del nombre de la vialidad, Ejemplo:
                               CALLE 45, CALLE B.
                            </Label>
                          </div>
                        </div>
                      </FormGroup>
                    </FormGroup>
                  </div>
                  <div className="centrado-fila mt-3">
                    {/* <Button
                      color="primary"
                      onClick={this.onSave.bind(this)}
                    >
                      Enviar
                    </Button> */}
                  </div>
                </Form>
              </div>
              <div>
                {this.state.modal ? (
                  <Modal1
                    cerrar={() => this.toggleM()}
                    // title={
                    //   this.state.modalIndex === 1
                    //     ? '¬°EXCELENTE!'
                    //     : this.state.modalIndex === 2
                    //       ? '¬°INTENTALO DE NUEVO!'
                    //       : this.state.modalIndex === 3
                    //         ? '¬°INTENTALO DE NUEVO!'
                    //         : null
                    // }

                    body={
                      this.state.modalIndex === 1 ? (
                        <div className="centrado-fila">
                          <div className="centrado-fila">
                            <h1 className="text-success">¬°EXCELENTE!</h1>
                          </div>
                          <div className="centrado-fila">
                            <img
                              src={excelente}
                              style={{ width: 300 }}
                              alt="excelente"
                              className="img-fluid  animated  bounceInRight delay"
                            />
                          </div>
                        </div>

                      ) : this.state.modalIndex === 2 ? (
                        <div className="centrado-fila">
                          <div className="centrado-fila">
                            <h1 className="text-dange">¬°INTENTALO DE NUEVO!</h1>
                          </div>
                          <div className="centrado-fila">
                            <img
                              src={intentalodenuevo}
                              style={{ width: 300 }}
                              alt="intentalodenuevo"
                              className="img-fluid  animated  bounceInRight delay"
                            />
                          </div>
                        </div>
                      ) : this.state.modalIndex === 3 ? (
                        <div className="centrado-fila">
                          <div className="centrado-fila">
                            <h1 className="text-dange">¬°INTENTALO DE NUEVO!</h1>
                          </div>
                          <div className="centrado-fila">
                            <img
                              src={intentalodenuevo}
                              style={{ width: 300 }}
                              alt="intentalodenuevo"
                              className="img-fluid  animated  bounceInRight delay"
                            />
                          </div>
                        </div>
                      ) : null
                    }
                  />
                ) : null}
              </div>
              {/* <p>{JSON.stringify(this.state)}</p> */}
            </Col>
          </Row>
        </CardBody>
      </div>
    )
  }
}
export default TA15View
